CREATE TABLE IF NOT EXISTS skaters20to22 (
    column1,
    column2,
    column3,
    column4,
    column5,
    column6,
    column7,
    column8,
    column9,
    column10,
    column11,
    column12,
    column13,
    column14,
    column15,
    column16,
    column17,
    column18,
    column19
);

-- Table: users
CREATE TABLE IF NOT EXISTS users (username TEXT PRIMARY KEY NOT NULL, password TEXT NOT NULL);

COMMIT TRANSACTION;
PRAGMA foreign_keys = on;
